using ObjectiveC;using System;using SwiftSharp.Attributes;using System.Collections.Generic;namespace Foundation{	/// <summary>	/// NSEnumerator is an abstract class, instances of whose subclasses enumerate collections of other objects, such as arrays and dictionaries.	/// </summary>	/// <see cref="https://developer.apple.com/library/prerelease/ios/documentation/Cocoa/Reference/Foundation/Classes/NSEnumerator_Class/index.html#//apple_ref/occ/cl/NSEnumerator"/>	[iOSVersion(2)]	public class NSEnumerator : NSObject, AnyObject, NSFastEnumeration, NSObjectProtocol	{		/// <summary>		/// Returns the next object from the collection being enumerated.		/// </summary>		[iOSVersion(2)]		[Export("nextObject")]		public AnyObject NextObject() { return default(AnyObject); }				/// <summary>		/// Returns an array of objects the receiver has yet to enumerate.		/// </summary>		[iOSVersion(2)]		[Export("allObjects")]		public AnyObject[] AllObjects { get; private set; }	}}